import React from 'react';
import './Projects.css';

function Projects() {
  return (
    <div className="grid-item projects">
      <h2>Projects</h2>
      <div className="container">
        <div className="row">
          <div className="bar">
            <div className="info">
              <h2>Project 1</h2>
              <p>Project description...</p>
            </div>
          </div>
          <div className="bar">
            <div className="info">
              <h2>Project 2</h2>
              <p>Project description...</p>
            </div>
          </div>
          {/* More projects */}
        </div>
      </div>
    </div>
  );
}

export default Projects;
